import React from 'react';

const Product = props => {
    const productItem = props.map(productel => {
        return <Product key={productel.posterPath} image={productel.image} name={productel.name} price={productel.price}/>
    });
    return (
        <div className='card-itemgrid'>
            <div className='card-img-itemgrid'>
                <img src={ this.props.image } alt="product img"/>
            </div>
            <div className='card-text-itemgrid'>
                <span className='product name'>
                    { this.props.name }
                </span>
                <span className='product price'>
                    { this.props.price }
                </span>
            </div>
        </div>
    );
}

export default Product;

